import { useAuth0 } from "@auth0/auth0-react"
import Cookies from "universal-cookie"
import "./style.css"
import Request from "../Request/index.jsx"
import {
	QuestionMarkCircleIcon,
	Cog6ToothIcon,
	ArrowLeftOnRectangleIcon,
	CreditCardIcon,
} from "@heroicons/react/24/outline"

const NavTray = ({ subscribed, setShowSettings }) => {
	const { logout } = useAuth0()
	const cookies = new Cookies()

	const clearCookies = async () => {
		cookies.remove("token")
	}

	const handleCheckout = (e) => {
		const commandsRequest = new Request("stripe/create-checkout-session/", {
			method: "POST",
		})

		commandsRequest
			.then((response) => {
				window.location.href = response.data.url
			})
			.catch((err) => {
				console.log(err)
			})
	}

	return (
		<div className='flex flex-col pb-6 text-[#F2F2F2] text-opacity-90 font-normal self-start w-full text-md'>
			<div className='border-t-[2px] border-[#2A1752] mb-4'></div>
			<a href='https://www.delilah.college/guide-and-faq' target='_blank'>
				<div className='nav-button'>
					<QuestionMarkCircleIcon className='h-5 w-5' />
					<p className='ml-2'> Guides and FAQ</p>
				</div>
			</a>
			<div className='nav-button' onClick={() => setShowSettings(true)}>
				<Cog6ToothIcon className='h-5 w-5' />
				<p className='ml-2'>Settings</p>
			</div>
			{!subscribed && (
				<div className='nav-button' onClick={handleCheckout}>
					<CreditCardIcon className='h-5 w-5' />
					<p className='ml-2'> Upgrade </p>
				</div>
			)}
			<div
				className='nav-button'
				onClick={() => {
					clearCookies().then(() =>
						logout({ returnTo: window.location.origin })
					)
				}}
			>
				<ArrowLeftOnRectangleIcon className='h-5 w-5' />
				<p className='ml-2'> Log Out </p>
			</div>
		</div>
	)
}

export default NavTray
